Nature Documentary hosted by Michael Mosley, published by BBC in 2014 - English narration


Information
------------------------------

Vets in the Disaster Zone
Michael Mosley travels to the Philippines in the aftermath of Typhoon Haiyan to explore the disaster from a completely fresh perspective - looking at the animals caught up in the crisis and the specialist team of vets who have come to save their lives and those of the people who depend on them. 
Amid the devastation, Michael learns about the little-known work these expert vets do, both in the short term by providing immediate veterinary care to thousands of animals and in the long term, by using their skills to develop pioneering technology that could help save millions of animals the next time a disaster strikes. He discovers what motivates this team to travel to some of the most dangerous places on earth to help animals and encounters many of the challenges they face as they work against the clock to leave a lasting legacy behind.

